import React, { Component } from 'react'
import cardImg from '../images/maincard.png';
import Navbar from './Navbar';
export default class MainCard extends Component {
    render() {
        return (
            <div>
            <div
          class="card pmd-card bg-dark "
          style={{ height: "82.5vh" }}
        >
          <img
            src={cardImg}
            alt="About"
            class="pmd-card-media"
            style={{ height: "82.5vh" }}
          />
          <div
            class="card-img-overlay"
          >
            <Navbar />
          </div>
        </div>
      </div>
                
        )
    }
}
